class scanner {
	ascii image;
	ascii number;
	ascii pattern;
	ascii pat[pN];
	used array;
	int w;
	int h;
	int h_p;
	int w_p;
	public:
		scanner();
		~scanner();
		void readASCII();
		void openPattern();
		void readNumbers(int aH, int aW);
		bool searchNumbers();
		void cutNumber(int aFirst, int aLast, ascii &aNumber);
		int findLast(ascii &aNumber);
		int findFirst(ascii &aNumber);
		void removeNumber(int aLast, ascii &aNumber);
		ascii scaling(ascii &aImage, int h_p, int w_p);
		int height(ascii &aNumber);
		int weigth(ascii &aNumber);
		ascii translate(ascii &aNumber);
		void makePattern(int n);
		int ASCIItoInt(char symbol);
		char InttoASCII(double number);
		int AtoI(char symbol);
		char ItoA(int number);
		double compare(ascii &aImage, ascii &aPattern);
};

scanner::scanner() {
	h = 0;
	w = 0;
}

void
scanner::cutNumber(int aFirst, int aLast, ascii &aNumber) {
	if (!aNumber.empty())
	{ 
		for (ascii::iterator it_col = aNumber.begin(); it_col != aNumber.end(); it_col++)
		{
			const_iter::iterator it_row=(*it_col).begin();
			(*it_col).erase(it_row+aLast, (*it_col).end()-1);
			(*it_col).erase(it_row, it_row + aFirst);
		}
		for (ascii::iterator it_col = aNumber.begin(); it_col != aNumber.end(); it_col++)
		{
			bool exist = false;
			for (const_iter::iterator it_row=(*it_col).begin(); it_row!=(*it_col).end(); it_row++) {
				if(*it_row == '#' || *it_row == '@') {
					exist = true;
				}
			}
			if(!exist)
				(*it_col).erase((*it_col).begin(), (*it_col).end());
		}
	}
}

void 
scanner::makePattern(int n) {
	for(int i = 0; i < pH; i++) {
			pat[n].resize(i+1);
		for(int j = 0; j < pW; j++) {
			pat[n][i].push_back(ItoA(patt[n][i][j]));
		}
		pat[n][i].push_back('\n');
	}
}

int
scanner::ASCIItoInt(char symbol) {
	switch(symbol) {
		case '@':
			return 255;
		case '#':
			return 170;
		case '%':
			return 85;
		case '.':
			return 0;
	}
}

int
scanner::AtoI(char symbol) {
	switch(symbol) {
		case '@':
			return 3;
		case '#':
			return 2;
		case '%':
			return 1;
		case '.':
			return 0;
	}
}

char
scanner::InttoASCII(double number) {
	if(number >=0 && number < 30)
		return '.';
	if(number >=30 && number < 110)
		return '%';
	if(number >=110 && number < 200)
		return '#';
	if(number >=200)
		return '@';
}

char
scanner::ItoA(int number) {
	switch(number) {
		case 0:
			return '.';
		case 1:
			return '%';
		case 2:
			return '#';
		case 3:
			return '@';
	}
}

ascii
scanner::translate(ascii &aNumber) {
	ascii tmp;
	int h_ = 0;
	bool is = false;
	if (!aNumber.empty())
	{ 
		tmp.resize(h_+1);
		for (int i = 0; i < aNumber.size(); i++)
		{
			is = false;
			for (int j = 0; j < aNumber[i].size();j++) {
				if(aNumber[i][j] == '#' || aNumber[i][j] == '@' || aNumber[i][j] == '%' || aNumber[i][j] == '.' || aNumber[i][j] == '\n') {
					tmp[h_].push_back(aNumber[i][j]);
					is = true;
				}
			}
			if(is) {
				h_++;
				tmp.resize(h_+1);
			}
		}
	}
	return tmp;
}

